    protected bool IsExportEnable()
    {
        try
        {
            return !IsExporting
                    //&& !BookingTypeEmpty
                    //&& !CustomerEmpty
                    && !BranchEmpty
                    && FormContext.Validate();
        }
        catch (Exception ex)
        {
            // show
            ErrorModalService.ShowErrorPopup("Error", ex.GetOriginalException()?.Message);
            return false;
        }
    }


